import ProductList from "../../assents/ProductList";
import { ProductCardContainer } from "./productCardStyle";

const ProductCard = ({ addToCart }) => {
  console.log(ProductList);

  const renderList = ProductList.map((product) => {
    return (
      <div key={product.id}>
        {product.id}
        {product.name}
        {product.imageUrl}
        {product.value}
      </div>
    );
  });

  return (
    <>
      <h3>Quantidade de produtos: 6</h3>
      <ProductCardContainer>
        {renderList}

        {/* <img src={product.imageUrl} alt={`imagem de ${product.name}`} />
          <p>{`Número ${product.id}`}</p>
          <h1>{product.name}</h1>
          <h2>{`R$ ${product.value}`}</h2> */}

        <button onClick={() => addToCart()}>Adicionar ao Carrinho</button>
      </ProductCardContainer>
    </>
  );
};

export default ProductCard;
